module.exports = a = async ({params}) => {
	let flowParametersObj = (params.flowParameters && params.flowParameters !== 'null' && params.flowParameters !== 'undefined' && params.flowParameters.length > 0) ? JSON.parse(params.flowParameters) : {};
	const results = { flowMethod: "REDIRECT" };

	const selectValue = (parameterValue, companyValue) => {
		if (parameterValue === undefined) {
			return companyValue;
		}

		// Assume WIDGET if any flowParameters is found
		results.flowMethod = "WIDGET";

		return parameterValue === "true";
	};

	// flow path variables
	results["flowAccountRecoveryEnabled"] = selectValue(flowParametersObj.isAccountRecoveryEnabled, params.ciam_accountRecoveryEnabled);
	results["flowMagicLinkEnabled"] = selectValue(flowParametersObj.isEmailMagicLinkEnabled, params.ciam_magicLinkEnabled);
	results["flowAgreementEnabled"] = selectValue(flowParametersObj.isTermsOfServiceEnabled, params.ciam_agreementEnabled);

	// Check whether Admin opted for Offering MFA or Requiring MFA
	results["flowRequireMFA"] = selectValue(flowParametersObj.isRequireMFA, params.ciam_requireMFA);

	// Check whether Protect Analysis is required or not
	results["flowProtectAnalysisRequired"] = selectValue(flowParametersObj.isProtectAnalysisRequired, params.ciam_protectAnalysisRequired);

	// Allowed device types: Initially allowing all device types
    const devices = [];
    devices.push("EMAIL", "FIDO2", "SMS", "TOTP", "VOICE", "MOBILE");

	results["flowAllowedDeviceTypes"] = devices.join(",");

	// social logins
	results["flowAppleEnabled"] = selectValue(flowParametersObj.isAppleEnabled, params.ciam_appleEnabled);
	results["flowFacebookEnabled"] = selectValue(flowParametersObj.isFacebookEnabled, params.ciam_facebookEnabled);
	results["flowGoogleEnabled"] = selectValue(flowParametersObj.isGoogleEnabled, params.ciam_googleEnabled);

	results["flowSocialRegistrationEnabled"] = results["flowAppleEnabled"] || results["flowFacebookEnabled"] || results["flowGoogleEnabled"];

	return { ...results };
}

